import { useContext } from 'react';
import DataContext from '../components/DataContext';
import Layout from '../components/Layout';

const AboutUs = (props) => {
  const { pages } = useContext(DataContext);
  console.log(pages);
  return (
  <>
    About us
  </>
)}

export default Layout(AboutUs);
